const getApiData = () => {
  fetch(
    "https://raw.githubusercontent.com/Adalab/rick-y-morty/master/data/rick-y-morty.json"
  )
    .then((response) => response.json())
    .then((data) => {});
};

export default {
  getApiData: getApiData,
};
